import torch
import numpy as np

class DNN(torch.nn.Module):
    def __init__(self,D_in,H1,H2,H3,H4,H5,D_out):
        super(DNN, self).__init__()

        self.l1 = torch.nn.Linear(D_in,H1)
        self.l2 = torch.nn.Linear(H1,H2)
        self.l3 = torch.nn.Linear(H2,H3)
        self.l4 = torch.nn.Linear(H3,H4)
        self.l5 = torch.nn.Linear(H4,H5)
        self.l6 = torch.nn.Linear(H5,D_out)

    def forward(self, x):
        h2 = torch.relu(self.l1(x))
        h3 = torch.relu(self.l2(h2))
        h4 = torch.relu(self.l3(h3))
        h5 = torch.relu(self.l4(h4))
        h6 = torch.relu(self.l5(h5))
        u = torch.relu(self.l6(h6))
        return u

